import logo from './logo.svg';
import './App.css';
import './styles.css'

function App() {
  return (
    <div className="App">
      <header className="header">
        <h1>Welcome To Moviedux</h1>
      </header>
      <footer className='footer'>
        <p className='footer'> Footer content goes here </p>
      </footer>
    </div>
  );
}

export default App;
